How to combine value match and pipeline operator in MongoDB?<h2>Example</h2>

<p>This is an example document:</p>

<pre><code>{
  row: [
    {
      identifier: "a"
      value: 52
    },
    {
      identifier: "b"
      value: 22
    },
    {
      identifier: "c"
      value: 36 
    }
  ]
}
</code></pre>

<h2>Problem</h2>

<p>Let's say I need the arrays first (<code>identifier</code> c) and last element (<code>identifier</code> c) but only where <code>value</code> is greater than 5 within the last element (<code>identifier</code> c). </p>

<p>Basically, I would like to combine these two conditions:</p>

<ul>
<li>Be <code>identifier a</code> or <code>identifier c</code></li>
<li>be greater than 5 when you are <code>identifier c</code>.</li>
</ul>

<p>Both conditions should be part of an aggregation pipeline. The result should look like this:</p>

<pre><code>[
  { 
    _id: 1, 
    row: [{ identifier: "a", value: 52}, { identifier: "c", value: 22}] 
  } //, ...
]
</code></pre>

<h2>Approach</h2>

<p>I tried many ways but nothing worked. Last thing I tried was <code>$cond</code>, but that also didn't work:</p>

<pre><code>'if': {
  'row.identifier': c,
  'then': {
    'row.value': {$gt: 5}
  }
}
</code></pre>

