Mongoose: Bulk upsert but only update records if they meet certain criteria<p>I am designing an item inventory system for a website that I am building.</p>

<p>The user's inventory is loaded from a Web API. This information is then processed so that it is more suited to my web app. I am trying to combine all the item records into one MongoDB collection - so other user inventories will be cached in the same place. What I have to deal with is deleting old item records if they are missing from the user's inventory (i.e. they sold it to someone) and also upserting the new items. Please note I have looked through several Stack Overflow questions about bulk upserts but I was unable to find anything about conditional updates.</p>

<p>Each item has two unique identifiers (<code>classId</code> and <code>instanceId</code>) that allow me to look them up (I have to use both IDs to match it) which remain constant. Some information about the item, such as its name, can change and therefore I want to be able to update those records when I fetch new inventory information. I also want new items that my site hasn't seen before to be added to my database.</p>

<p>Once the data returned from the Web API has been processed, it is left in a large array of objects. This means I am able to use bulk writing, however, I am unaware of how to upsert with conditions with multiple records.</p>

<p>Here is part of my item schema:</p>

<pre><code>const ItemSchema = new mongoose.Schema({
    ownerId: {
        type: String,
        required: true
    },
    classId: {
        type: String,
        required: true
    },
    instanceId: {
        type: String,
        required: true
    },
    name: {
        type: String,
        required: true
    }
    // rest of item attributes...
});
</code></pre>

<p>User inventories typically contain 600 or more items, with a max count of 2500. </p>

<p>What is the most efficient way of upserting this much data? Thank you</p>

<h2>Update:</h2>

<p>I have had trouble implementing the solution to the bulk insert problem. I made a few assumptions and I don't know if they were right. I interpreted <code>_</code> as lodash, <code>response.body</code> as the JSON returned by the API and <code>myListOfItems</code> also as that same array of items.</p>

<pre><code>import Item from "../models/item.model";
import _ from 'lodash';

async function storeInventory(items) {
    let bulkUpdate = Item.collection.initializeUnorderedBulkOp();

    _.forEach(items, (data) =&gt; {
        if (data !== null) {
            let newItem = new Item(data);
            bulkUpdate.find({
                classId: newItem.classId,
                instanceId: newItem.instanceId
            }).upsert().updateOne(newItem);
            items.push(newItem);
        }
    });

    await bulkUpdate.execute();
}
</code></pre>

<p>Whenever I run this code, it throws an error that complains about an <code>_id</code> field being changed, when the schema objects I created don't specify anything to do with schemas, and the few nested schema objects don't make a difference to the outcome when I change them to just objects.</p>

<p>I understand that if no <code>_id</code> is sent to MongoDB it auto generates one, but if it is updating a record it wouldn't do that anyway. I also tried setting <code>_id</code> to null on each item but to no avail.</p>

<p>Have I misunderstood anything about the accepted answer? Or is my problem elsewhere in my code?</p>

